// src/pages/PlayerRegister.js
import React from 'react';
import PlayerForm from '../components/PlayerForm';

export default function PlayerRegister() {
  return (
    <div style={{ padding: 32 }}>
      <h1>Register New Player</h1>
      <PlayerForm />
    </div>
  );
}
